import React from 'react';

const Navbar = () => {
  const [isMenuOpen, setMenuOpen] = React.useState(false);

  const handleMenuToggle = () => {
    setMenuOpen(!isMenuOpen);
  };

  return (
    <nav className="navbar" style={{ backgroundColor: 'red' }}>
      <div className="navbar-logo">
        <img src="/path/to/main-logo.png" alt="Main Logo" />
      </div>
      <div className={`navbar-menu ${isMenuOpen ? 'active' : ''}`}>
        <ul className="navbar-list">
          <li className="navbar-item">Option 1</li>
          <li className="navbar-item">Option 2</li>
          <li className="navbar-item">Option 3</li>
          <li className="navbar-item">Option 4</li>
          <li className="navbar-item">Option 5</li>
          <li className="navbar-item navbar-item-right">Logout</li>
        </ul>
      </div>
      <div className="navbar-mobile-menu">
        <img
          src="/path/to/triple-line-logo.png"
          alt="Triple Line Logo"
          onClick={handleMenuToggle}
        />
        {isMenuOpen && (
          <ul className="navbar-mobile-list">
            <li className="navbar-mobile-item">Option 1</li>
            <li className="navbar-mobile-item">Option 2</li>
            <li className="navbar-mobile-item">Option 3</li>
            <li className="navbar-mobile-item">Option 4</li>
            <li className="navbar-mobile-item">Option 5</li>
            <li className="navbar-mobile-item navbar-mobile-item-right">Logout</li>
          </ul>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
